    "Action toy figures are dynamic collectibles that often represent characters from movies, comics, or video games. These figures typically feature articulated joints for posing and display, allowing for creative play and customization. Common materials include durable plastics that withstand rough handling, making them suitable for both collectors and children. Many action figures come with accessories or interchangeable parts to enhance playability and realism. This category excludes non-poseable figures and static collectibles that do not offer interactive features.",
    "Figures encompass a wide range of collectible items that can be displayed or played with, often representing popular characters from various media. These items may include poseable action figures, limited edition collectibles, and miniature replicas that appeal to enthusiasts and casual fans alike. Many figures are designed with intricate details and articulation, allowing for dynamic poses and creative display options. Common materials include vinyl and plastic, ensuring durability and longevity for collectors. This category does not include dolls or accessories that are specifically designed for doll play.",
    "Dolls accessories include a variety of items designed to enhance the play experience with dolls, such as clothing, furniture, and playsets. These accessories are often crafted from safe, durable materials that are easy to handle and maintain, ensuring they can withstand regular use. Common items include doll clothes, shoes, and themed furniture that allow for imaginative play scenarios. Many accessories are designed to fit specific doll sizes, providing a tailored experience for users. This category excludes dolls themselves and any unrelated toy items that do not directly enhance doll play."
